import React, { Component } from "react";
import data from "./data.json";

function Movie({ match }) {
  const movie = data.find((a) => a.slug === match.params.title);
  console.log(movie);
  let flag = true;
  if (movie === undefined) {
    flag = false;
  }
  console.log(flag);
  return flag ? <div></div> : <div></div>;
}

export default Movie;
